import React, { Component } from "react";
import axios from "axios";

class IdeaSubmission extends Component {
  state = {};

  formSubmitHandler = (e) => {
    const data = FormData(e);
    axios
      .post("http://127.0.0.1:8000/api-blog/ideas/", data)
      .then((res) => {
        console.log(res);
      })
      .catch((err) => {
        console.log(err);
      });
  };

  render() {
    return (
      <form onSubmit={this.formSubmitHandler} name="ideaForm">
        <label>
          Name: <input type="text" name="username" />
        </label>
        <label>
          Email Id: <input type="email" name="emailid" />
        </label>
        <label>
          Contact: <input type="text" name="contact" />
        </label>
        <label>
          Name: <textarea name="ideaContent"></textarea>
        </label>
      </form>
    );
  }
}

export default IdeaSubmission;
